var tipuesearch = {"pages": [{'title': 'About', 'text': '設計一甲 \n 40823103 \n 呂霈瑜 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n we have\xa0 \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Grouping', 'text': '1a \n wcmg1 組長: 40823131 40823126 40823123 40823124 40823128 \n wcmg2 組長: 40823112 40823108 40823109 40823111 40823145 \n wcmg3 組長: 40823125 40823129 40823137 40823136 40823151 \n wcmg4 組長:\xa040823110 40823103 40823107 40823130 40823142 \n wcmg5 組長:\xa040823143 40823144 40543118 40823127 \n', 'tags': '', 'url': 'Grouping.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'W9-W11', 'text': '說明如何利用 Python 程式讀取學員修課檔案, 以及從 Google Sheet 轉出的 .csv, 分別處理為 List 與 Dictionary 資料格式之後, 逐一根據學員 List 學號, 從 Dictionary 取出自評成績. \n import csv\n \n# read student list\n \nfilename = \'E:/wcm2020/data/tmp/2020_spring_score/2a/2a_list.txt\'\nwith open(filename, encoding="utf-8") as f:\n    content = f.readlines()\n#print(content)\nstudent = [x.strip() for x in content] \n#print(student)\n \n \n# Timestamp, email, 修課名稱, url, score, desp, memo\n# 0, 1, 2, 3, 4, 5, 6\n#total = 0\nall = {}\nwith open(\'y:/2020midterm.csv\', encoding="utf-8") as csv_file:\n    csv_reader = csv.reader(csv_file, delimiter=\',\')\n    #print(csv_reader)\n \n    line_count = 0\n    for row in csv_reader:\n        if line_count == 0:\n            #print(f\'Column names are {", ".join(row)}\')\n            line_count += 1\n        else:\n            student_num = row[1].split("@")[0]\n            #print(student_num)\n            student_score = row[4]\n            #print(student_score)\n            try:\n                all.update({student_num: student_score})\n            except:\n                all.update({student_num: "error"})\n            #print(f\'\\t{row[0]} works in the {row[1]} department, and was born in {row[2]}.\')\n            #print(f\'\\t{row[4]}\')\n            #total += int(row[4])\n            line_count += 1\n#print(all)\n#print(student)\n \n \nfor i in student:\n     \n    #if i in all:\n        #pass\n    #else:\n        #print(str(i))\n     \n    try:\n        print(i + "\\t" + all[i])\n    except:\n        print(i + "\\t60")\n \n    #print(f\'Processed {line_count} lines.\')\n    #print("平均=" + str(total/line_count)) \n Python and Flask \n Login to your gm email account and download \xa0 2019_ABeginnersGuideToPython3Programming.pdf \n Login to your gm email account and download \xa0 2019_BuildingRESTAPIsWithFlask.pdf \n https://github.com/mstamy2/PyPDF2 \n https://mde.tw/cd2020pj1 \n W9 \n https://www.blog.pythonlibrary.org/2018/06/07/an-intro-to-pypdf2/ \n https://github.com/topics/pypdf2 \n https://flask.palletsprojects.com/en/1.1.x/patterns/fileuploads/ \n Flask 與 SQLite \n W11 \n 簡介網際內容管理與計算機程式及電腦輔助設計與實習課程的關聯性 \n W11 教學影片-1 \xa0 (登入 @gm 後可以在線觀看) \n 使用 SSH push github 倉儲改版教學影片 \xa0 (登入 @gm 後可以在線觀看) \n 說明如何將網際 Python 放入 Virtualbox 虛擬主機中 \n Virtualbox Ubuntu 虛擬主機使用教學影片 \xa0 (登入 @gm 後可以在線觀看) \n Ubuntu 20.04 wcm2020.ova 下載 \xa0 (登入 @gm 後可以下載) \n', 'tags': '', 'url': 'W9-W11.html'}, {'title': 'W12-W15', 'text': 'W12 \n 說明 如何在 Windows 10 中安裝 Ubuntu 20.04 Virtualbox 虛擬主機教學影片 \xa0 (for @gm users only) \n 說明 期末專案與 cd2020pj1 的關聯教學影片 \xa0 (for @gm users only) \n cd2020pj1 倉儲 \n W13 \n 完成 IPv6 實體主機搭建: \xa0 http://wcm.kmol.info \xa0(IP 為 ~17:2020::1) \n 準備將 \xa0 https://github.com/mdecourse/cd2020pj1.git \xa0進行開機啟動配置. \n 各分組嘗試建立 wcm1.kmol.info ~ wcm4.kmol.info 等實體主機. \n IP 將分別設為 ~17:2020::2 至 ~ 17:2020::5 \n 符號名稱分別為: wcm1.kmol.info ～ wcm4.kmol.info \n 安裝 NGINX WWW Server: \n sudo apt install nginx \n nginx 設定檔案位於 /etc/nginx/nginx.conf 可用於配置 CMSiMDE 靜態網頁 \n 若在純 IPv6 下需要設定 Proxy, 則在 /etc/apt/apt.conf.d 中需要新增 proxy.conf, 內容如下: \n Acquire::http::Proxy "http://[proxy_ip_address]:3128"; \n 設定時區: \n sudo timedatectl set-timezone Aia/Taipei \n W13 教學影片 _導入 Filezilla 協助管理 Ubuntu 20.04 實體主機 (for @gm users only) \n W14 \n Ubuntu 20.04 編譯 NGINX 教學影片 1 \xa0 (for @gm users only) \n Ubuntu 20.04 編譯 NGINX 教學影片 2 \xa0 (for @gm users only) \n 各分組除了將 W1-W13 週之上課內容整理至個人及分組的網際內容管理系統之外, 將在虛擬與實體主機上完成網際 PDF 檔案管理系統. \n W15 \n 利用 Pypdf2 切割 pdf 檔案教學影片 \xa0 (for @gm users only) \n 利用 HxD 編修 pip.exe 教學影片 \xa0 (for @gm users only) \n https://mh-nexus.de/en/hxd/ \n https://bootstrap.pypa.io/get-pip.py \n https://en.wikipedia.org/wiki/STL_(file_format) \n 說明如何在 cd2020pj1 網際程式架構下納入 pypdf2 的功能 教學影片 \xa0 (for @gm users only) \n https://github.com/mdecourse/cd2020pj1 \n', 'tags': '', 'url': 'W12-W15.html'}, {'title': 'W16-W17', 'text': 'W16 \n cd2020pj1 網際程式開發說明影片之一 \xa0 (for @gm users only) \n cd2020pj1 網際程式開發說明影片之二 \xa0 (for @gm users only) \n cd2020pj1 網際程式開發說明影片之三 \xa0 (for @gm users only) \n W17 \n cd2020pj1 pdf 網際分割與合併程式說明 \xa0 (for @gm users only)', 'tags': '', 'url': 'W16-W17.html'}]};